import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import styles from './Navbar.module.css';

export class Navbar extends Component {
    saveCat = (name, image) => {
        fetch('/create', {
            method: 'POST',
            body: JSON.stringify({
                name: name,
                image: image
            }),
            headers: {"Content-Type": "application/json"}
        });
    }
    render() {
        return (
            <nav className={styles.Navbar}>
                <div className={styles.homeBtn}>
                    <Link to={'./'}>
                        <button className={styles.NavbarBtn}>
                            home
                        </button>
                    </Link>
                </div>
                <div className={styles.OptionBtns}>
                    <Link to={'./list'}>
                        <button className={styles.NavbarBtn}>
                            My List
                        </button>
                    </Link>
                    <Link to={'./latestBlog'}>
                        <button className={styles.NavbarBtn}>
                            saveCat
                        </button>
                    </Link>
                    <Link to={'./users'}>
                        <button className={styles.NavbarBtn}>
                            My User
                        </button>
                    </Link>
                    <Link to={'./Contact'}>
                        <button className={styles.NavbarBtn}>
                            Contact Me
                        </button>
                    </Link>
                    <button onClick={() => this.saveCat("Bass Creek", "https://placeimg.com/640/480/nature")} className={styles.NavbarBtn}>
                        Create
                    </button>
                </div>
            </nav>
        )
    }
}

export default Navbar
